import React from "react";
import { useDispatch } from "react-redux";
import { useSelector } from "react-redux";
import { useState, useEffect } from "react";
import { searchTypes } from "../actions";
import { NavLink } from "react-router-dom";

export function CreatePok() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(searchTypes());
  }, []);
  const types = useSelector((state) => state.types);

  const [input, setInput] = useState({
    name: "",
    type: [],
    img: "",
    hp: "",
    attack: "",
    defense: "",
    speed: "",
    id: "",
    height: "",
    weight: "",
  });
  function handleChande(e) {
    setInput({ ...input, [e.traget.name]: e.target.value });
  }
  return (
    <div>
      <NavLink to="/pokemon">Go Back</NavLink>
      <form>
        <label>Name</label>
        <input type="text" value={input.name} name="name" />
        <label>Img</label>
        <input type="text" value={input.name} name="img" />
        <label>Type</label>
        <input type="text" value={input.name} name="type" />
        <label>Hp</label>
        <input type="number" value={input.name} name="hp" />
        <label>Attack</label>
        <input type="number" value={input.name} name="attack" />
        <label>Defense</label>
        <input type="number" value={input.name} name="defense" />
        <label>Speed</label>
        <input type="number" value={input.name} name="speed" />
        <label>Id</label>
        <input type="number" value={input.name} name="id" />
        <label>Height</label>
        <input type="number" value={input.name} name="height" />
        <label>Weight</label>
        <input type="number" value={input.name} name="weight" />
        <button type="submit">Create your Pokemon!</button>
      </form>
    </div>
  );
}
export default CreatePok;
